import React, { useState, useEffect, useRef } from 'react';
import { TransitionGroup, CSSTransition } from 'react-transition-group';
import './App.css';

const PRIORITY_WEIGHTS = {
  high: 3,
  medium: 2,
  low: 1,
};

export default function App() {
  const [tasks, setTasks] = useState([]);
  const [priorityFilter, setPriorityFilter] = useState('all');

  useEffect(() => {
    const fetchTasks = async () => {
      await new Promise(resolve => setTimeout(resolve, 1000));
      const mockTasksData = [
        { id: 1, title: 'Complete project proposal', deadline: '2025-05-25T10:00:00', priority: 'high' },
        { id: 2, title: 'Review team submissions', deadline: '2025-05-21T15:30:00', priority: 'medium' },
        { id: 3, title: 'Update documentation', deadline: '2025-05-28T12:00:00', priority: 'low' },
        { id: 4, title: 'Prepare client presentation', deadline: '2025-05-19T09:00:00', priority: 'high' },
        { id: 5, title: 'Weekly team meeting', deadline: '2025-05-22T14:00:00', priority: 'medium' },
        { id: 6, title: 'Budget planning', deadline: '2025-05-30T16:00:00', priority: 'low' },
        { id: 7, title: 'Stakeholder report', deadline: '2025-05-18T11:00:00', priority: 'high' },
      ];

      const processedTasks = mockTasksData.map(task => ({
        ...task,
        urgencyScore: calculateUrgencyScore(task),
      }));
      setTasks(processedTasks);
    };

    fetchTasks();
  }, []);

  function calculateUrgencyScore(task) {
    const deadlineDate = new Date(task.deadline);
    const currentDate = new Date();
    const timeDiff = deadlineDate.getTime() - currentDate.getTime();
    const daysDiff = Math.ceil(timeDiff / (1000 * 3600 * 24));
    const adjustedDays = daysDiff < 0 ? daysDiff * 10 : Math.max(0.5, daysDiff);
    return adjustedDays / PRIORITY_WEIGHTS[task.priority];
  }

  const filteredTasks = tasks.filter(task =>
    priorityFilter === 'all' ? true : task.priority === priorityFilter
  );

  const sortedTasks = [...filteredTasks].sort((a, b) => a.urgencyScore - b.urgencyScore);

  const formatDate = (dateStr) => {
    const options = {
      year: 'numeric',
      month: 'short',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit',
    };
    return new Date(dateStr).toLocaleDateString(undefined, options);
  };

  const getUrgencyLabel = (score) => {
    if (score < 0) return 'Critical';
    if (score < 1) return 'Urgent';
    if (score < 3) return 'High';
    if (score < 7) return 'Medium';
    return 'Low';
  };

  return (
    <div className="app">
      <h1>Task Manager Dashboard</h1>

      <div className="filter">
        <label htmlFor="priorityFilter">Filter by Priority:</label>
        <select
          id="priorityFilter"
          value={priorityFilter}
          onChange={(e) => setPriorityFilter(e.target.value)}
        >
          <option value="all">All</option>
          <option value="high">High</option>
          <option value="medium">Medium</option>
          <option value="low">Low</option>
        </select>
      </div>

      <TransitionGroup className="task-list">
        {sortedTasks.map(task => {
          const nodeRef = useRef(null);
          return (
            <CSSTransition
              key={task.id}
              nodeRef={nodeRef}
              timeout={300}
              classNames="task-item"
            >
              <div ref={nodeRef} className="task-item">
                <h3>{task.title}</h3>
                <p>Deadline: {formatDate(task.deadline)}</p>
                <p>Priority: {task.priority}</p>
                <p>Urgency: {getUrgencyLabel(task.urgencyScore)}</p>
              </div>
            </CSSTransition>
          );
        })}
      </TransitionGroup>
    </div>
  );
}
